To solve this problem, we can use Floyd's algorithm, also known as the "tortoise and the hare" algorithm, to detect the cycle in the linked list. The algorithm uses two pointers that move at different speeds through the list. If there is a cycle, these two pointers will eventually meet at some point within the cycle.

        Here is a Python implementation of Floyd's algorithm:

        ```python
        class Node:
            def __init__(self, value):
                self.value = value
                self.next = None

        class LinkedList:
            def __init__(self):
                self.head = None

            def append(self, value):
                new_node = Node(value)
                if not self.head:
                    self.head = new_node
                else:
                    current = self.head
                    while current.next:
                        current = current.next
                    current.next = new_node

            def detect_cycle(self):
                tortoise = self.head
                hare = self.head
                while hare and hare.next:
                    tortoise = tortoise.next
                    hare = hare.next.next
                    if tortoise == hare:
                        return True
                return False

            def find_cycle_length(self):
                tortoise = self.head
                hare = self.head
                while hare and hare.next:
                    tortoise = tortoise.next
                    hare = hare.next.next
                    if tortoise == hare:
                        break
                if not hare or not hare.next:
                    return None  # No cycle detected
                cycle_length = 0
                tortoise = hare
                while tortoise.next!= hare.next:
                    tortoise = tortoise.next
                    cycle_length += 1
                return cycle_length

        # Create a linked list with 80 nodes and a cycle
        linked_list = LinkedList()
        for i in range(80):
            linked_list.append(i)
        linked_list.head.next.next = linked_list.head.next  # Create a cycle

        # Detect cycle and calculate cycle length
        cycle_detected = linked_list.detect_cycle()
        if cycle_detected:
            cycle_length = linked_list.find_cycle_length()
            print(f"Cycle detected. Cycle length: {cycle_length} nodes")
        else:
            print("No cycle detected")
```

        This code defines a `Node` class and a `LinkedList` class with methods to append nodes, detect cycles, and find cycle lengths. The `detect_cycle` method uses Floyd's algorithm to detect the presence of a cycle. If a cycle is detected, the `find_cycle_length` method is used to calculate the cycle length.

        In the example code, a linked list with 80 nodes is created and a cycle is introduced by setting the `next` pointer of the second node to the first node. The `detect_cycle` method is then used to detect the presence of a cycle, and if detected, the `find_cycle_length` method is used to calculate the cycle length.

        The output of the code will be the cycle length if a cycle is detected, or a message indicating that no cycle was detected.
